import Home from './home';
import Airport from './Airport.jsx'
import Login from './Login.tsx'
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
      <Routes>
        <Route path="/" element={
          <Login>
            <Home />
          </Login>
        }/>
        <Route path="/:airport" element={<Airport />} />
        <Route path="/login" element={<Login /> } />
      </Routes>
  );
}

export default App;
